import pickle


with open("exchanges.pkl", "rb") as file:
    exchanges = pickle.load(file)

_symbols = {}
for type, exch in exchanges.items():
    _symbols[type] = set()
    for exchange, bases in exch.items():
        _symbols[type].update({base for base, _ in bases.items()})


symbols = dict(
    top_tier=_symbols['top_tier'],
    secondary=_symbols['secondary'].difference(_symbols['top_tier']),
    inactive=_symbols['inactive'].difference(_symbols['secondary']).difference(_symbols['top_tier'])
)

for type, symbols in symbols.items():
    print("-", type, ":")
    print("Count:", len(symbols))
    print("List:", list(symbols))

